import { BrowserRouter , Routes , Route , Link } from "react-router-dom";



const Subproject1=()=>{

  return <div>
    subproject
  </div>

}
const Subproject2=()=>{

  return <div>
    subproject
  </div>

}

export default function Project1() {



  return (
    <div style={{marginTop:"200px"}}>
        <BrowserRouter>
        <h1>this is zifcare</h1> 
        <Routes>
        <Route path="/"  element={<Subproject1 />} />
        <Route path="/project2"  element={<Subproject2 />} />
        </Routes>
        </BrowserRouter>


      
    </div>
  )
}
